import React from "react";
import { PowerBIEmbed } from "powerbi-client-react";

const PowerBI = () => {
  return (
    <div>
      <PowerBIEmbed
        embedConfig={{
          type: "report",
          id: "<Report Id>",
          embedUrl: "<Embed Url>",
          accessToken: "<Access Token>",
          tokenType: models.TokenType.Embed,
          settings: {
            panes: {
              filters: {
                expanded: false,
                visible: false,
              },
            },
            background: models.BackgroundType.Transparent,
          },
        }}
        
      ></PowerBIEmbed>
    </div>
  );
};

export default PowerBI;
